import React, { useState } from "react";
import "../css/appointmentForm.css";

const AppointmentForm: React.FC = () => {
  const [patientName, setPatientName] = useState("");
  const [date, setDate] = useState("");
  const [time, setTime] = useState("");

  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
    // Lógica para enviar os dados da consulta para o backend
    console.log("Dados da consulta enviados:", { patientName, date, time });
    // Limpar o formulário após o envio
    setPatientName("");
    setDate("");
    setTime("");
  };

  return (
    <div className="appointment-form-container">
      <h2 className="appointment-form-title">Agendar Consulta</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label className="appointment-form-label">Nome do Paciente:</label>
          <input
            type="text"
            value={patientName}
            onChange={(e) => setPatientName(e.target.value)}
            className="appointment-form-input"
          />
        </div>
        <div>
          <label className="appointment-form-label">Data:</label>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="appointment-form-input"
          />
        </div>
        <div>
          <label className="appointment-form-label">Hora:</label>
          <input
            type="time"
            value={time}
            onChange={(e) => setTime(e.target.value)}
            className="appointment-form-input"
          />
        </div>
        <button type="submit" className="appointment-form-button">
          Agendar
        </button>
      </form>
    </div>
  );
};

export default AppointmentForm;
